import React, { useEffect, useState } from "react"; 
import { MapContainer, TileLayer, Marker, Popup, Polygon } from "react-leaflet";
import L from "leaflet";
import tileLayer from "../util/tileLayer";

const center = [38.9637, 35.2433];
const colors = ["fe4848", "fe6c58", "fe9068", "feb478", "fed686"];
const labels = ["2-12.5", "12.6-16.8", "16.9-20.9", "21-25.9", "26-plus"];

function customMarkerIcon(color) {
  const svgTemplate = `
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" class="marker">
      <path fill-opacity=".25" d="M16 32s1.427-9.585 3.761-12.025c4.595-4.805 8.685-.99 8.685-.99s4.044 3.964-.526 8.743C25.514 30.245 16 32 16 32z"/>
      <path fill="#${color}" stroke="#fff" d="M15.938 32S6 17.938 6 11.938C6 .125 15.938 0 15.938 0S26 .125 26 11.875C26 18.062 15.938 32 15.938 32zM16 6a4 4 0 100 8 4 4 0 000-8z"/>
    </svg>`;

  return new L.DivIcon({
    className: "test",
    html: svgTemplate,
    iconSize: [30, 30],
    iconAnchor: [12, 24], 
  });
}

const MyMarkers = ({ data }) => {
  const [selectedPoint, setSelectedPoint] = useState(null);
  const [filteredData, setFilteredData] = useState([]);

  const handleMarkerClick = (point) => {
    setSelectedPoint(point); 
    const filtered = data.filter(item => item.city_id === point.city_id);
    setFilteredData(filtered);
  };

  return (
    <>
      {data.map((item, index) => (
        <Marker
          key={index}
          icon={customMarkerIcon(colors[index])}
          position={[parseFloat(item.city_latitude), parseFloat(item.city_longitude)]}
          eventHandlers={{
            click: () => handleMarkerClick(item),
          }}
        >
          {selectedPoint === item && (
            <Popup>
              <div className="popup-content">
                <table className="popup-table">
                  <thead>
                    <tr>
                      <th className="popup-header">Sözleşme Numarası</th> 
                      <th className="popup-header">Tahakkuk Grubu</th>
                      {/* Diğer sütunlar */}
                    </tr>
                  </thead>
                  <tbody>
                    {filteredData.map((filteredItem, filteredIndex) => (
                      <tr key={filteredIndex}>
                        <td>{filteredItem.contract_number}</td> 
                        <td>{filteredItem.group_title}</td>
                        {/* Diğer sütunlar */}
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            </Popup>            
          )}
        </Marker>
      ))}
    </>
  );
};

const Legend = ({ map }) => {
  useEffect(() => {
    if (!map) return;

    const legend = L.control({ position: "bottomright" });

    const rows = [];
    legend.onAdd = () => {
      const div = L.DomUtil.create("div", "legend");

      return div;
    };

    legend.addTo(map);
  }, [map]);

  return null;
};

const MapWrapper = () => {
  const [map, setMap] = useState(null);
  const [points, setPoints] = useState([]);
  const [clickedPosition, setClickedPosition] = useState(null);

  const datas = [/* Your data here */];

  useEffect(() => {
    setPoints(datas);
  }, []);

  const handleMapClick = (e) => {
    const { lat, lng } = e.latlng;
    setClickedPosition([lat, lng]);
  };

  return (
    <MapContainer
      whenCreated={setMap}
      center={center}
      zoom={6}
      scrollWheelZoom={true} 
      onClick={handleMapClick} // Ekledik
    >
      <TileLayer {...tileLayer} />

      {clickedPosition && (
        <Marker position={clickedPosition} />
      )}

      <MyMarkers data={points} />

      <Legend map={map} />
    </MapContainer>
  );
};

export default MapWrapper;
